function clNet=elabCheckMatrixLUTNetwork(this,topNet,blockInfo,dataRate)





    ufix1Type=pir_boolean_t;
    ufix2Type=pir_ufixpt_t(2,0);
    ufix4Type=pir_ufixpt_t(4,0);
    layType=pir_ufixpt_t(blockInfo.layWL,0);
    vcType=pir_ufixpt_t(blockInfo.vaddrWL,0);
    eType=pirelab.getPirVectorType(ufix1Type,blockInfo.memDepth);
    if strcmpi(blockInfo.LDPCConfiguration,'(8160,7136) LDPC')
        aType=pir_ufixpt_t(5,0);
        nType=pir_ufixpt_t(10,0);
        cType=pir_ufixpt_t(8,0);
        c1Type=pir_ufixpt_t(32,0);
        vType=pir_ufixpt_t(6,0);
        v1Type=pir_ufixpt_t(24,0);
        rType=pir_ufixpt_t(16,0);
    else
        aType=pir_ufixpt_t(9,0);
        nType=pir_ufixpt_t(13,0);
        cType=pir_ufixpt_t(9,0);
        c1Type=pir_ufixpt_t(45,0);
        vType=pir_ufixpt_t(7,0);
        v1Type=pir_ufixpt_t(35,0);
        rType=pir_ufixpt_t(32,0);
    end
    erType=pir_ufixpt_t(31,0);


    if strcmpi(blockInfo.LDPCConfiguration,'(8160,7136) LDPC')
        clNet=pirelab.createNewNetwork(...
        'Network',topNet,...
        'Name','CheckMatrixLUT',...
        'Inportnames',{'lenIdx','rateIdx','layerIdx','validCount'},...
        'InportTypes',[ufix2Type,ufix2Type,layType,vcType],...
        'InportRates',[dataRate,dataRate,dataRate,dataRate],...
        'Outportnames',{'colVal','shiftVal','rdEnable','wrEnable'},...
        'OutportTypes',[cType,vType,eType,eType]...
        );
    else
        clNet=pirelab.createNewNetwork(...
        'Network',topNet,...
        'Name','CheckMatrixLUT',...
        'Inportnames',{'lenIdx','rateIdx','layerIdx','validCount'},...
        'InportTypes',[ufix2Type,ufix2Type,layType,vcType],...
        'InportRates',[dataRate,dataRate,dataRate,dataRate],...
        'Outportnames',{'colVal','shiftVal','rdEnable','eraseCol'},...
        'OutportTypes',[cType,vType,eType,ufix1Type]...
        );
    end



    lenidx=clNet.PirInputSignals(1);
    rateidx=clNet.PirInputSignals(2);
    layeridx=clNet.PirInputSignals(3);
    validcount=clNet.PirInputSignals(4);

    colval=clNet.PirOutputSignals(1);
    shiftval=clNet.PirOutputSignals(2);
    rdenable=clNet.PirOutputSignals(3);
    if strcmpi(blockInfo.LDPCConfiguration,'(8160,7136) LDPC')
        wrenable=clNet.PirOutputSignals(4);
    else
        erasecol=clNet.PirOutputSignals(4);
    end

    addr=clNet.addSignal(aType,'addr');
    ncolumn=clNet.addSignal(nType,'nColVal');
    rdaddr=clNet.addSignal(nType,'rdAddr');

    const1=clNet.addSignal(ufix1Type,'const1');
    pirelab.getConstComp(clNet,const1,1);

    countlayerd=clNet.addSignal(layeridx.Type,'cntlayer_Sub');
    pirelab.getSubComp(clNet,[layeridx,const1],countlayerd,'floor','wrap','Sub Comp');

    vcountd=clNet.addSignal(validcount.Type,'vcount_Add');
    pirelab.getAddComp(clNet,[validcount,const1],vcountd,'floor','wrap','AddComp');


    if strcmpi(blockInfo.LDPCConfiguration,'(8160,7136) LDPC')
        pirelab.getWireComp(clNet,countlayerd,addr,'');
    else
        idx_con=clNet.addSignal(ufix4Type,'indexConcat');
        sumval=clNet.addSignal(aType,'sumVal');
        pirelab.getBitConcatComp(clNet,[lenidx,rateidx],idx_con,'');
        pirelab.getDirectLookupComp(clNet,idx_con,sumval,blockInfo.sumLUT,'sumLUT','','','','',aType);
        pirelab.getAddComp(clNet,[sumval,countlayerd],addr,'floor','wrap','Add Comp');
    end

    pirelab.getDirectLookupComp(clNet,addr,ncolumn,blockInfo.ncolLUT,'nColumnsLUT','','','','',nType);
    pirelab.getAddComp(clNet,[ncolumn,validcount],rdaddr,'floor','wrap','Add Comp');


    if strcmpi(blockInfo.LDPCConfiguration,'(8160,7136) LDPC')
        columnstmp=columnPCMLUTBase(clNet,addr,cType,c1Type,vcountd);
        vshifttmp=shiftPCMLUTBase(clNet,addr,vType,v1Type,vcountd);
        rdenbtmp=readEnableLUTBase(this,clNet,rdaddr,rType,ufix1Type);
        wrenbtmp=writeEnableLUTBase(this,clNet,rdaddr,rType,ufix1Type);

        pirelab.getUnitDelayComp(clNet,wrenbtmp,wrenable,'',0);
    else
        rdaddr_reg=clNet.addSignal(nType,'rdAddrReg');
        pirelab.getUnitDelayComp(clNet,rdaddr,rdaddr_reg,'',0);

        columnstmp=columnPCMLUTAr4ja(clNet,addr,cType,c1Type,vcountd);
        vshifttmp=shiftPCMLUTAr4ja(clNet,addr,vType,v1Type,vcountd);
        rdenbtmp=readEnableLUTAr4ja(this,clNet,rdaddr_reg,rType,ufix1Type);
        erasetmp=eraseColLUTAr4ja(clNet,addr,ufix1Type,erType,vcountd);

        pirelab.getUnitDelayComp(clNet,erasetmp,erasecol,'',0);
    end

    pirelab.getUnitDelayComp(clNet,columnstmp,colval,'',0);
    pirelab.getUnitDelayComp(clNet,vshifttmp,shiftval,'',0);
    pirelab.getUnitDelayComp(clNet,rdenbtmp,rdenable,'',0);

end

